import React from 'react';
import { Route } from 'react-router-dom';
import FrontendLayout from './layouts/frontend/FrontendLayout';

function PublicRoute({ component: Component, ...rest }) {
  return (
    <Route 
      {...rest} 
      render={(props) => (
        <FrontendLayout>
          <Component {...props} />
        </FrontendLayout>
      )} 
    />
  );
}

export default PublicRoute;
